package com.leetcode.easy;

import java.util.HashMap;
import java.util.Map;

public class ValidAnagram {
    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }

        int[] sMap = new int[26];
        int[] tMap = new int[26];

        int len = s.length();
        for (int i = 0; i < len; i++) {
            sMap[s.charAt(i) - 'a']++;
            tMap[t.charAt(i) - 'a']++;
        }

        for (int i = 0; i < sMap.length; i++) {
            if (sMap[i] != tMap[i]) {
                return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {
        ValidAnagram test = new ValidAnagram();
        String s = "anagram";
        String t = "nagaram";
        System.out.println(test.isAnagram(s, t) == true);

        s = "rat";
        t = "car";
        System.out.println(test.isAnagram(s, t) == false);

        s = "";
        t = "";
        boolean a = test.isAnagram(s, t);
        System.out.println(test.isAnagram(s, t));
    }
}
